sys_variable_value.value:
(function execute(inputs, outputs) {
  var responseObj = JSON.parse(inputs.response_body);
  users = [];
  var numOfUsers = responseObj.length;
  for(var i = 0; i < numOfUsers; i++) {
    users[i] = {};
  	users[i].name = responseObj[i].name;
  	users[i].email = responseObj[i].email;
  	users[i].admin = responseObj[i].admin;
  	users[i].policyManager = responseObj[i].policyManager;
  	users[i].watchManager = responseObj[i].watchManager;
  	users[i].reportsManager = responseObj[i].reportsManager;
  	users[i].groupAdmin = responseObj[i].groupAdmin;
  	users[i].profileUpdatable = responseObj[i].profileUpdatable;
  	users[i].internalPasswordDisabled = responseObj[i].internalPasswordDisabled;
  	users[i].lastLoggedIn = responseObj[i].lastLoggedIn;
  	users[i].lastLoggedInMillis = responseObj[i].lastLoggedInMillis;
  	users[i].status = responseObj[i].status;
  	users[i].credentialsExpired = responseObj[i].credentialsExpired;
  	users[i].numberOfGroups = responseObj[i].numberOfGroups;

    if("groups" in responseObj[i]){
      users[i].groups = [];
      for(var j = 0; j < responseObj[i].groups.length; j++) {
        users[i].groups[j] = responseObj[i].groups[j];
      }
    }
  }

  outputs.users_list = JSON.stringify(users);
})(inputs, outputs);

